import React, { Component } from 'react'
import data from './data'

const usersData = data.user;
export default class DashBoard extends Component {
    render() {
        console.log(data)
        return (
            <div>
               <h1>DashBoard with data: </h1>
               <table>
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>Name</th>
                            <th>Age</th>
                            <th>Gender</th>
                            <th>Email</th>
                            <th>Phone Number</th>
                        </tr>
                    </thead>
                    <tr>
                    {
                        usersData.map((s,i) => (<td> key={i}>{s.id}</td>))
                    }
                    </tr>
                </table>
            </div>
        )
    }
}
